import Board from 'react-trello';
import React, { useState, useEffect } from 'react';

const DragDrop = () => {
  const count = 0;
  const data = {
    lanes: [
      {
        id: 'lane1',
        title: 'Planned Tasks',
        label: '2/2',
        cards: [
          {
            id: 'Card1',
            title: 'Write Blog',
            description: 'Can AI make memes',
            label: 'count',
          },
          {
            id: 'Card2',
            title: 'Pay Rent',
            description: 'Transfer via NEFT',
            label: '5 mins',
            metadata: { sha: 'be312a1' },
          },
        ],
      },
      {
        id: 'lane2',
        title: 'Completed',
        label: '0/0',
        cards: [],
      },
    ],
  };
  useEffect(() => {
    data.lanes.map((a) => {
      if (a.id === 'lane1') {
        console.log()
      }
      console.log(a);
    });
  }, []);
  return (
    <>
      <Board data={data} />
    </>
  );
};

export default DragDrop;
